import React from "react";
import { UseSelector } from "react-redux";

function Home() {
  const user = UseSelector((state) => state.user.value);
  return (
    <div>
      <h1>Home</h1>
      <li>{user.name}</li>
      <li>{user.email}</li>
    </div>
  );
}

export default Home;
